script: |
  super -f text -I q7845.spq | sort > q7845.out

inputs:
  - name: q7845.spq
    data: |
      SELECT + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE + 0 * + CAST ( NULL AS REAL ) * - - ( col1 ) - - CAST ( + col1 AS INTEGER ) NOT BETWEEN 70 AND + + 0;
  - name: tab0

outputs:
  - name: q7845.out
    data: |
